import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-color: #000; /* 배경색을 검정으로 설정 */
`;

const CircleWrapper = styled.div`
  position: relative;
  width: 300px;
  height: 300px;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: #e7d355; /* 원의 배경색 설정 */
    border-radius: 50%;
    z-index: -1;
  }
`;

const Image = styled.img`
  width: 100%;
  height: 100%;
  border-radius: 50%;
  object-fit: cover;
`;

const Choice = ()=>{
    return (
        <Container>
          <Circle>
            <Image src={'Frontend/react-team5/src/assets/travel.jpg'} alt="Example" />
          </Circle>
        </Container>
      );
}
export default Choice;
